            <img alt="HomePage Img" src="https://images.unsplash.com/photo-1566779342022-8e33031b622c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1867&q=80" class="responsive"/>
            <UserLogin />
        </>
    );
};

export default Home;
